function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
      </header>
      <img src="https://example.com/car1.jpg" alt="Car 1"></img>
      <img src="https://example.com/car2.jpg" alt="Car 2"></img>
      <img src="https://example.com/car3.jpg" alt="Car 3"></img>
    </div>
  );
}

export default App;
